(6, ' Create a Scanner object and print the entered input', 'import java.util.Scanner;  // Import the Scanner class\n\nclass pgm {\n  public static void main(String[] args) {\n    Scanner myObj = new Scanner(System.in);  // Create a Scanner object\n    System.out.println(&quot;Enter username&quot;);\n\n    String userName = myObj.nextLine();  // Read user input\n    System.out.println(&quot;Username is: &quot; + userName);  // Output user input\n  }\n}', 'guru', 'raj', 'swagath', 'vishram', 'prajwal', 'java', 'Enter username\nUsername is: raj\n', 'Enter username\nUsername is: swagath\n', 'Enter username\nUsername is: vishram\n', 'Enter username\nUsername is: prajwal\n'),
(7, 'program to check whether the character is an alphabet or not', '#include &lt;stdio.h&gt;\nint main()\n{\nchar ch;\nprintf(&quot;Enter a character: &quot;);\nscanf(&quot; %c&quot;,&amp;ch);\nprintf(&quot;\\n&quot;);\nif( (ch &gt;= &#x27;a&#x27; &amp;&amp; ch &lt;= &#x27;z&#x27;) || ( ch &gt;= &#x27;A&#x27; &amp;&amp; ch &lt;=&#x27;Z&#x27;))\nprintf(&quot;%c is an alphabet\\n&quot;,ch);\nelse\nprintf(&quot;%c is not an alphabet\\n&quot;,ch);\n\nreturn 0;\n}', 'a', '1', 'z', 'A', '0', 'cpp', 'Enter a character: \n1 is not an alphabet\n', 'Enter a character: \nz is an alphabet\n', 'Enter a character: \nA is an alphabet\n', 'Enter a character: \n0 is not an alphabet\n');
